import React from 'react'
import {Grid} from 'semantic-ui-react'

import pokemon from 'pokemonDatabase.json'

console.log(pokemon)

function App() {
  return (
    <Grid>
      <Grid.Row>
        <Grid.Column width={10}>Column1</Grid.Column>
        <Grid.Column width={6}>Column2</Grid.Column>
      </Grid.Row>
    </Grid>
  )
}

export default App;
